package ex_08_Switch;

public class Lab0085_interview {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		char code = 'C';
		
		switch(code) {
		default:
			System.out.println("Helloooo");
			break;
			
		case 'A':
			System.out.println("65");
			break;
			
		case 'B':
			System.out.println("66");
			break;
		}
	}

}
